import React, { useEffect, useState } from "react";
import "./Circle.css";

export default function Circle() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results[0]));
  }, []);

  console.log(user);
  const r = 200 / (Math.PI * 2)
  const d = r * 2

  console.log(d, r)

  return (
    <div className="container">
      <svg height="250" width="250" className="circle">
        <path
          d="
        m 125 2.0845
        a 31.8309 31.8309 0 0 1 0 63.66197
        a 31.8309 31.8309 0 0 1 0 -63.66197"
        fill="transparent"
        stroke="#0D5474"
        ></path>
        <text x="50%" y="50%" fill="white" textAnchor="middle">
          {user.first_name} {user.last_name}
        </text>
      </svg>
    </div>
  );
}
